'    var matches = url.match(/\/([^\/\?]{32})($|\?)/);',
'    if (matches) return matches[1];',
'    return null;',
'}',
'$(''.FingerItem'').each(function (i, el) {',
'    var model = $(this).FingerItem(''broadcast'');',
'    if (!model.has(''MissingReason'') && model.has(''ImageUrl'')) {',
'        tempFinger.push({',
'            "image": {',
