'            },',
'            "nistImpressionType": model.get(''ImpressionType'').ordinal,',
'            "nistPosition": model.get(''Position'').ordinal',
'        });',
'    }',
'});',
'',
'$(''.FaceItem'').each(function (i, el) {',
