'                type: ''error'',',
'                location: ''page'',',
'                message: apex.lang.getMessage(''RECORD.INSERT.ERROR'') + '' '' + message',
'            });',
'        }',
'    }',
'    catch (e) {',
'        apex.message.clearErrors();',
'        apex.message.showErrors({',
'            type: ''error'',',
'            location: ''page'',',
'            message: apex.lang.getMessage(''RECORD.INSERT.ERROR'')',
'        })',
